import React, { Component } from 'react';
import Axios from 'axios';

export default class App extends Component {
    constructor(){
        super();
        this.state = {
            indexData: []
        }
    }

    componentDidMount(){
        this.selectDefault();
        console.log(this.state.indexData);
    }


    selectDefault = async () => {
        const value = await Axios.get('http://localhost:8080/').then(
            res => this.setState({indexData:res})
        ).catch(
            err => console.log(err)
        );

        return value;
    }
    render() {
        return (
            <div>Hello There !</div>
        );
    }
}
